Hi there,

After having some time to think about this, I think we should adopt the approach where we move RG creation to the resource groups module (as you have here). But remove all notion of resource group creation from the virtual networks variable.

Of course we will need a reference, but we can do this using the map key of the resource group, for example:

```terraform
module "lz-vending" {
  # ... other attributes
  virtual_networks = {
    vnet_one = {
      name = "vnet1"
      address_space = ["192.168.0.0/24"]
      resource_group_key = "rg_one" # reference by map key
    }
  }
  resource_groups = {
    rg_one = {
      name     = "rg1"
      location = "westus3"
    }
  }
}
```

In the code we can then pass in the resource id of the RG once it has been created.

We would also look to include locks in the RG submodule to provide equivalent functionality.

@andreadegiovine 

I agree with @chmtc94, as I'm also unclear how the following should be implemented.
> Add a new method (e.g., "get_energy_map") for the iterations that returns the correct maps, and use it for "get_value_from_map" and "get_updated_at_from_map" when the first key is "energies."

How would the new function (e.g., "get_energy_map") select and return the correct map, e.g., for the autonomy sensor?
Can you please explain your approach?

